import { Link } from "react-router-dom"

function Home({ data, setCount }) {
    // console.log(data);
    return (
        <div>
            <h2> You Click  : {data} Times</h2>
            <button onClick={() => { setCount(data + 1) }}>Click</button>
            <h3><Link to='/products'>Go to products page</Link></h3>
           
        </div>
    )
}
export default Home
